						["custom"] = "function(event, arg1, arg2, arg3, arg4)\n    if event == \"HYLB_RESET\" and arg1 then\n        aura_env.topLeft = false\n        aura_env.topRight = false\n        aura_env.bottomLeft = false\n        aura_env.bottomRight = false\n        \n        aura_env.topLeftM = \"\"\n        aura_env.topRightM = \"\"\n        aura_env.bottomLeftM = \"\"\n        aura_env.bottomRightM = \"\"\n    elseif event == \"HYLB_TOPLEFT\" and arg2 then\n        aura_env.topLeft = arg2\n        aura_env.topLeftM = arg4 or \"\"\n    elseif event == \"HYLB_TOPRIGHT\" and arg2 then\n        aura_env.topRight = arg2\n        aura_env.topRightM = arg4 or \"\"\n    elseif event == \"HYLB_BOTTOMLEFT\" and arg2 then\n        aura_env.bottomLeft = arg2\n        aura_env.bottomLeftM = arg4 or \"\"\n    elseif event == \"HYLB_BOTTOMRIGHT\" and arg2 then\n        aura_env.bottomRight = arg2\n        aura_env.bottomRightM = arg4 or \"\"\n    elseif event == \"HYLB_SEND\" and arg1 \n    and aura_env.topLeft and aura_env.topRight\n    and aura_env.bottomLeft and aura_env.bottomRight\n    then\n        local message = format(\"%s*%s*%s*%s\", aura_env.topLeft, aura_env.topRight, aura_env.bottomLeft, aura_env.bottomRight)\n        C_ChatInfo.SendAddonMessage(\"HYLB_PERSONAL\", message, IsInGroup(LE_PARTY_CATEGORY_INSTANCE) and \"INSTANCE_CHAT\" or \"PARTY\")\n        \n        local text = format(\"%s%s   %s%s\", aura_env.topLeftM, aura_env.topLeft, aura_env.topRightM, aura_env.topRight)\n        aura_env.send(text)\n        \n        text = format(\"%s%s   %s%s\", aura_env.bottomLeftM, aura_env.bottomLeft, aura_env.bottomRightM, aura_env.bottomRight)\n        aura_env.send(text)\n    end\nend",
