			["url"] = "https://wago.io/HMhtQ3KIy/4",
			["actions"] = {
				["start"] = {
					["custom"] = "if not aura_env.region._btnStart then\n    aura_env.region._btnStart = CreateFrame(\"BUTTON\", nil, aura_env.region,\"SecureActionButtonTemplate\")\nend\naura_env.region._btnStart:SetAllPoints()\naura_env.region._btnStart:SetScript(\"OnClick\", function()\n        if aura_env.debug then print(\"Starting\") end\n        aura_env.runeIndex = 1\n        aura_env.runeColor = {}\n        aura_env.runeSlot = {}\n        aura_env.runeButton = {}\n        \n        -- init Rune Slots\n        for i=1,4 ,1 do\n            if not aura_env.runeSlot[i] then\n                aura_env.runeSlot[i] = CreateFrame(\"Frame\", nil, aura_env.region)\n            end\n            \n            aura_env.runeSlot[i]:SetSize(48,48)\n            aura_env.runeSlot[i]:SetPoint(\"BOTTOM\", aura_env.region,(i%2)*(-24)+(i%2-1)*(-24),(math.floor(i/2.2)-1)*(-48)+22)\n            aura_env.runeSlot[i].tex = aura_env.runeSlot[i]:CreateTexture()\n            aura_env.runeSlot[i].tex:SetTexture(\"134400\")\n            aura_env.runeSlot[i].tex:SetAllPoints(aura_env.runeSlot[i])\n            aura_env.runeSlot[i].tex:SetAlpha(0.85)\n            \n            aura_env.runeSlot[i].text = aura_env.runeSlot[i]:CreateFontString(nil, \"ARTWORK\", \"GameFontNormal\")\n            aura_env.runeSlot[i].text:SetFont(\"Fonts\\\\ARIALN.ttf\", 32, \"OUTLINE\")\n            aura_env.runeSlot[i].text:SetPoint(\"CENTER\",0,0)\n            aura_env.runeSlot[i].text:SetText(i)\n            \n            aura_env.runeSlot[i]:Show()\n        end\n        \n        ---------------------------------\n        \n        -- init Rune buttons --\n        \n        ---------------------------------4 rune buttons\n        for i=1,4 ,1 do\n            if not aura_env.runeButton[i] then\n                aura_env.runeButton[i] = CreateFrame(\"Button\", nil, aura_env.region, \"SecureActionButtonTemplate\")\n            end\n            \n            aura_env.runeButton[i]:SetSize(48,48)\n            aura_env.runeButton[i]:SetPoint(\"TOP\", aura_env.region,(i-2.5)*48,-22)\n            aura_env.runeButton[i]:SetNormalTexture(aura_env.colorTextureID[i])\n            aura_env.runeButton[i]:RegisterForClicks(\"AnyUp\")\n            aura_env.runeButton[i]:SetScript(\"OnClick\", function (self, button, down)\n                    if aura_env.debug then print(aura_env.colorName[i]) end\n                    aura_env.runeColor[aura_env.runeIndex] = aura_env.colorName[i]\n                    \n                    aura_env.runeSlot[aura_env.runeIndex].tex:SetTexture(aura_env.colorTextureID[i])\n                    aura_env.runeButton[i]:Hide()\n                    \n                    aura_env.runeIndex = aura_env.runeIndex+1\n            end)\n            aura_env.runeButton[i]:Show()\n        end\n        \n        ---------------------------------OK button\n        if not aura_env.btnSendtoChat then\n            aura_env.btnSendtoChat = CreateFrame(\"Button\", nil, aura_env.region, \"SecureActionButtonTemplate\")\n        end\n        \n        aura_env.btnSendtoChat:SetSize(48,48)\n        aura_env.btnSendtoChat:SetPoint(\"TOP\", aura_env.region,-24,-70)\n        aura_env.btnSendtoChat:SetNormalTexture(\"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Textures\\\\ok-icon.tga\")\n        aura_env.btnSendtoChat:RegisterForClicks(\"AnyUp\")\n        \n        for i=1,4,1 do\n            if aura_env.runeColor[i] == nil then \n                aura_env.runeColor[i] = \"??\"\n            end\n        end\n        \n        aura_env.btnSendtoChat:SetScript(\"OnClick\", function (self, button, down)\n                print(\"send\")\n                SendChatMessage(\"1. \"..\"{\"..aura_env.runeColor[1]..\"}\"..\"    2. \"..\"{\"..aura_env.runeColor[2]..\"}\", \"WHISPER\", nil, \"Sunnyrain\")\n                SendChatMessage(\"3. \"..\"{\"..aura_env.runeColor[3]..\"}\"..\"    4. \"..\"{\"..aura_env.runeColor[4]..\"}\", \"WHISPER\", nil, \"Sunnyrain\")\n                \n                aura_env.btnCancelAll:Click()\n        end)\n        \n        ---------------------------------Cancel button\n        if not aura_env.btnCancelAll then\n            aura_env.btnCancelAll = CreateFrame(\"Button\", nil, aura_env.region, \"SecureActionButtonTemplate\")\n        end\n        \n        aura_env.btnCancelAll:SetSize(48,48)\n        aura_env.btnCancelAll:SetPoint(\"TOP\", aura_env.region,24,-70)\n        aura_env.btnCancelAll:SetNormalTexture(\"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Textures\\\\cancel-mark.tga\")\n        aura_env.btnCancelAll:RegisterForClicks(\"AnyUp\")\n        aura_env.btnCancelAll:SetScript(\"OnClick\", function (self, button, down)\n                if aura_env.debug then print(\"cancel\") end\n                \n                aura_env.btnSendtoChat:Hide()\n                aura_env.btnCancelAll:Hide()\n                for i=1,4,1 do\n                    aura_env.runeButton[i]:Hide()\n                    aura_env.runeSlot[i]:Hide()\n                    \n                    aura_env.runeColor[i] = nil\n                    aura_env.runeButton[i] = nil\n                    aura_env.runeSlot[i] = nil\n                end\n                aura_env.runeIndex = 1\n                \n                aura_env.region._btnStart:Show()\n        end)\n        \n        -- init ends --\n        \n        aura_env.btnSendtoChat:Show()\n        aura_env.btnCancelAll:Show()\n        \n        for i=1,4,1 do\n            aura_env.runeButton[i]:Show()\n            aura_env.runeSlot[i]:Show()\n        end\n        \n        aura_env.region._btnStart:Hide()\n    end\n    \n)\n\nreturn true",
