					["custom"] = "local frame = aura_env.GetFrame(aura_env.wplayer)\nif frame then\n    local LBG = LibStub(\"LibButtonGlow-1.0\")\n    table.insert(aura_env.frameTable, frame)\n    LBG.ShowOverlayGlow(frame)\nend\n\n\n\n",
