				},
				["init"] = {
					["custom"] = "local triggerWords = {\"pi\", \"infusion\", \"infu\"};\n\n\naura_env.player = nil;\naura_env.messageAvailable = \"Power Infusion is available\";\naura_env.messageOnCD = \"Power Infusion is on cd %d s\";\naura_env.messageDead = \"I am dead, genius\";\n\n\nlocal function isTriggerWord(word)\n  for _, value in ipairs(triggerWords) do\n    if strlower(value) == strlower(word) then \n      return true\n    end\n  end\n  \n  return false\nend\n\n\nlocal function answerToPIRequest(message, player)\n  local start, duration, _ = GetSpellCooldown(10060);\n  \n  local messageAvailable = aura_env.messageAvailable;\n  local messageOnCD = aura_env.messageOnCD;\n  local messageDead = aura_env.messageDead;\n  \n  if duration > 2 then\n    local remainingTime = (start + duration) - GetTime();\n    local msg = format(messageOnCD, remainingTime);\n    \n    SendChatMessage(msg, \"WHISPER\", nil, player);\n    return false;\n  else\n    if UnitIsDeadOrGhost(\"player\") then\n      SendChatMessage(messageDead, \"WHISPER\", nil, player);\n      return false;\n    else\n      aura_env.player = player;\n      SendChatMessage(messageAvailable, \"WHISPER\", nil, player);\n      return true;\n    end\n  end\nend\n\n\nlocal function prettyPlayerName(player)\n  return WA_ClassColorName(Ambiguate(player, \"short\"))\nend\n\n\n\naura_env.isTriggerWord = isTriggerWord;\naura_env.answerToPIRequest = answerToPIRequest;\naura_env.prettyPlayerName = prettyPlayerName;",
