			["wagoID"] = "ZFjPVNNUz",
			["parent"] = "M+ AUTO MARK DFS2",
			["displayText"] = "",
			["customText"] = "function ()\n    local m\n    for k,v in pairs(aura_env.partyMembers) do \n        if v.marker then \n            m = k\n        end\n    end\n    return m and \"|c00FF7D0A[M+ AUTO MARK] Current marker: |r\"..m or \"|c00FF7D0A[M+ AUTO MARK] Current marker: |r|c00FFFFFFNone|r\"\nend",
			["shadowYOffset"] = -1,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["customTextUpdate"] = "event",
			["automaticWidth"] = "Auto",
			["actions"] = {
				["start"] = {
					["do_custom"] = false,
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "C_ChatInfo.RegisterAddonMessagePrefix(\"MYTHICAUTOMARK\")\naura_env.rc = LibStub(\"LibRangeCheck-2.0\")\nlocal config = aura_env.config.settings\naura_env.mobs = {}\naura_env.range = {\n    [1] = function(_, guid)\n        for i = 1, 40, 1 do \n            if guid == UnitGUID(\"nameplate\"..i) then return true end\n        end\n    return false end,\n    [2] = function() return true end,\n    [3] = function(r) return r and r<=40 or false end,\n    [4] = function(r) return r and r<=50 or false end,\n    [5] = function(r) return r and r<=60 or false end,\n    [6] = function(r) return r and r<=70 or false end,\n    [7] = function(r) return r and r<=80 or false end,\n    [8] = function(r) return r and r<=90 or false end,\n    [9] = function(r) return r and r<=100 or false end,\n    [10] = function() return false end,\n}\naura_env.marks = {\n    [1] = {\n        [\"active\"] = false, \n        [\"next\"] = {},\n    }, \n    [2] = {\n        [\"active\"] = false, \n        [\"next\"] = {},\n    }, \n    [3] = {\n        [\"active\"] = false, \n        [\"next\"] = {},\n    }, \n    [4] = {\n        [\"active\"] = false, \n        [\"next\"] = {},\n    }, \n    [5] = {\n        [\"active\"] = false, \n        [\"next\"] = {},\n    }, \n    [6] = {\n        [\"active\"] = false, \n        [\"next\"] = {},\n    }, \n    [7] = {\n        [\"active\"] = false, \n        [\"next\"] = {},\n    }, \n    [8] = {\n        [\"active\"] = false, \n        [\"next\"] = {},\n    }, \n}\naura_env.specializationName = {\n    [250] = \"TANK\",\n    [581] = \"TANK\",\n    [104] = \"TANK\",\n    [268] = \"TANK\",\n    [66] = \"TANK\",\n    [73] = \"TANK\",\n    [105] = \"HEALER\",\n    [270] = \"HEALER\",\n    [65] = \"HEALER\",\n    [256] = \"HEALER\",\n    [257] = \"HEALER\",\n    [264] = \"HEALER\",\n    [251] = \"DAMAGER\",\n    [252] = \"DAMAGER\",\n    [577] = \"DAMAGER\",\n    [102] = \"DAMAGER\",\n    [103] = \"DAMAGER\",\n    [253] = \"DAMAGER\",\n    [254] = \"DAMAGER\",\n    [255] = \"DAMAGER\",\n    [62] = \"DAMAGER\",\n    [63] = \"DAMAGER\",\n    [64] = \"DAMAGER\",\n    [269] = \"DAMAGER\",\n    [70] = \"DAMAGER\",\n    [258] = \"DAMAGER\",\n    [259] = \"DAMAGER\",\n    [260] = \"DAMAGER\",\n    [261] = \"DAMAGER\",\n    [262] = \"DAMAGER\",\n    [263] = \"DAMAGER\",\n    [265] = \"DAMAGER\",\n    [266] = \"DAMAGER\",\n    [267] = \"DAMAGER\",\n    [71] = \"DAMAGER\",\n    [72] = \"DAMAGER\",\n}\n\naura_env.GetInstanceID = function()\n    -- Returns a STRING with the Instance ID the player curently is in. \n    return tostring(select(8, GetInstanceInfo())) or \"\" \nend\n\naura_env.GetChatType = function()\n    -- Returns a STRING with the Chat Type for 'SendAddonMessage'\n    return IsInGroup(LE_PARTY_CATEGORY_INSTANCE) and \"INSTANCE_CHAT\" or \"PARTY\"\nend\n\naura_env.GetPlayerName = function()\n    return string.format(\"%s-%s\", UnitFullName(\"player\"))\nend\n\naura_env.playerWantsToMark = function()\n    local role = UnitGroupRolesAssigned(\"player\") == \"NONE\" and aura_env.specializationName[GetSpecializationInfo(GetSpecialization())] or UnitGroupRolesAssigned(\"player\")\n    return config.markerInfo.role == 1 \n    or (config.markerInfo.role == 2 and role == \"TANK\") \n    or (config.markerInfo.role == 3 and UnitIsGroupLeader(\"player\"))\n    or (config.markerInfo.role == 4 and (UnitIsGroupLeader(\"player\") or role == \"TANK\"))\nend\n\naura_env.partyMembers = {\n    [aura_env.GetPlayerName()] = {\n        [\"role\"] = UnitGroupRolesAssigned(\"player\") == \"NONE\" and aura_env.specializationName[GetSpecializationInfo(GetSpecialization())] or UnitGroupRolesAssigned(\"player\"),\n        [\"leader\"] = UnitIsGroupLeader(\"player\"),\n        [\"players\"] = config.playerMarks.tank > 1 or config.playerMarks.healer > 1,\n        [\"decider\"] = C_PlayerInfo.GetPlayerMythicPlusRatingSummary(\"player\").currentSeasonScore,\n        [\"mobs\"] = aura_env.playerWantsToMark(),\n        [\"marker\"] = aura_env.playerWantsToMark(),\n        [\"build\"] = 1,\n    }\n}\n\naura_env.CreateMarkOnUnitId = function(unitId, guid, markID)\n    for _,v in pairs(aura_env.marks) do if v.guid == guid and v.active then return end end -- Mob is alrdy marked\n    local npcID = select(6, strsplit(\"-\", guid))\n    npcID = tonumber(npcID)\n    if UnitGUID(unitId) ~= guid then -- UnitId has been lost, try to restore it. \n        for i = 1, 40, 1 do \n            if guid == UnitGUID(\"nameplate\"..i) then unitId = \"nameplate\"..i break end \n        end\n    end\n    if aura_env.mobs[npcID].build == 1 and not markID then -- Standard Build \n        for i = 1, 4, 1 do -- Check if any Prio marks are set\n            local prio = aura_env.mobs[npcID][\"prio\"][i]\n            if prio < 9 and (not aura_env.marks[prio].active or (aura_env.marks[prio].time and GetTime()-aura_env.marks[prio].time > 60)) then\n                markID = prio\n                break\n            end\n        end\n        if not markID then -- No prio marks, using random marks\n            for i = 1, 8, 1 do\n                -- Getting value from first markOrder option\n                local k = tonumber(9-config.markOptions[\"markOrder\"..i])\n                if (not aura_env.marks[k].active or \n                    (aura_env.marks[k].time and GetTime()-aura_env.marks[k].time > 60)) \n                and config.markOptions[\"toggleMark\"..k] \n                and 10-config.playerMarks.tank ~= k \n                and 10-config.playerMarks.healer ~= k then \n                    markID = k\n                    break\n                end\n            end\n        end\n    end\n    if aura_env.mobs[npcID].build == 2 and not markID then -- Modified Build\n        local mob = aura_env.mobs[npcID]\n        local step = tonumber(mob.step)\n        local mark, type, next = tonumber(mob.prio[step].mark), tonumber(mob.prio[step].type), tonumber(mob.prio[step].next)\n        if type == 1 then markID = mark -- Mark: Force »\n        elseif type == 2 then -- Mark: Use next available from Mark Order »\n            for i = 1, 8, 1 do \n                local k = tonumber(9-config.markOptions[\"markOrder\"..i])\n                -- Getting value from first markOrder option\n                if (not aura_env.marks[k].active \n                    or (aura_env.marks[k].time and GetTime()-aura_env.marks[k].time > 60))\n                and config.markOptions[\"toggleMark\"..k] \n                and 10-config.playerMarks.tank ~= k \n                and 10-config.playerMarks.healer ~= k then \n                    markID = k\n                    break\n                end\n            end\n        elseif type == 3 then -- Mark: If Available »\n            if not aura_env.marks[mark].active then markID = mark end\n        elseif type == 4 then -- Mark: If Available or Add to Queue »\n            if not aura_env.marks[mark].active then -- Mark is not active\n                markID = mark \n            elseif aura_env.marks[mark].active then -- Mark is active, add to Queue\n                local nameplate\n                for i = 1, 40, 1 do \n                    if guid == UnitGUID(\"nameplate\"..i) then \n                        nameplate = \"nameplate\"..i \n                        break\n                    end\n                end\n                if nameplate then \n                    aura_env.marks[mark].next[guid] = {[\"nameplate\"] = nameplate}\n                end\n            end\n        end\n        aura_env.mobs[npcID].step = next\n    end\n    if markID then \n        aura_env.marks[markID].guid, aura_env.marks[markID].time, aura_env.marks[markID].active = guid, GetTime(), true\n        local message = string.format(\"%s:%s:%s\", \"AUTOMARK_ANNOUNCE\", npcID, markID)\n        C_ChatInfo.SendAddonMessage(\"MYTHICAUTOMARK\", message, aura_env.GetChatType())\n        return SetRaidTarget(unitId, markID)\n    end\nend\n\naura_env.updatePlayerMarks = function()\n    if not select(2, UnitFullName(\"player\")) then return end\n    local name = UnitFullName(\"player\") and string.format(\"%s-%s\", UnitFullName(\"player\")) or nil\n    if aura_env.partyMembers[name].marker and aura_env.partyMembers[name].players then \n        for i = 0, GetNumGroupMembers(), 1 do \n            local pointer = i == 0 and \"player\" or (\"party\"..i)\n            if UnitGroupRolesAssigned(pointer) == \"TANK\" then \n                SetRaidTarget(pointer, 10-config.playerMarks.tank)\n            end\n            if UnitGroupRolesAssigned(pointer) == \"HEALER\" then \n                SetRaidTarget(pointer, 10-config.playerMarks.healer)\n            end\n        end\n    end\nend\n\naura_env.sendPlayerInfo = function()\n    -- ROLE - MarkMobs - MarkPlayers - LEADER - TankIcon - HealerIcon - Decider\n    local role = UnitGroupRolesAssigned(\"player\") == \"NONE\" and aura_env.specializationName[GetSpecializationInfo(GetSpecialization())] or UnitGroupRolesAssigned(\"player\")\n    local leader, score = UnitIsGroupLeader(\"player\"), C_PlayerInfo.GetPlayerMythicPlusRatingSummary(\"player\").currentSeasonScore\n    local markMobs = config.markerInfo.role == 1 or (config.markerInfo.role == 2 and role == \"TANK\") or (config.markerInfo.role == 3 and leader) or (config.markerInfo.role == 4 and (leader or role == \"TANK\"))\n    local markPlayers = (config.playerMarks.tank > 1 or config.playerMarks.healer > 1)\n    local msg = string.format(\"%s:%s:%s:%s:%s:%s\", role, tostring(markMobs), tostring(markPlayers), tostring(leader), score, aura_env.partyMembers[aura_env.GetPlayerName()].build)\n    return C_ChatInfo.SendAddonMessage(\"MYTHICAUTOMARK\", \"WHO_MARK^\"..msg, aura_env.GetChatType())\nend\n\naura_env.sendRoleCall = function()\n    -- Send message to others to update\n    return C_ChatInfo.SendAddonMessage(\"MYTHICAUTOMARK\", \"UPDATE_ME^nil\", aura_env.GetChatType())\nend\n\naura_env.convertAddonMsg = function(msg)\n    local t = {}\n    local m = {strsplit(\":\", msg)}\n    for _,v in pairs(m) do \n        if tonumber(v) then v = tonumber(v)\n        elseif v == \"true\" then v = true \n        elseif v == \"false\" then v = false\n        end\n        t[#t+1] = v\n    end\n    return unpack(t)\nend",
					["do_custom"] = true,
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["custom_hide"] = "timed",
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["custom_type"] = "event",
						["names"] = {
						},
						["duration"] = "10",
						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["customDuration"] = "",
						["events"] = "GROUP_ROSTER_UPDATE, UPDATE_MOUSEOVER_UNIT, NAME_PLATE_UNIT_ADDED, UNIT_THREAT_LIST_UPDATE, READY_CHECK, CHALLENGE_MODE_START, PARTY_MEMBER_ENABLE, START_TIMER, MODIFIER_STATE_CHANGED",
						["custom"] = "function(event, unitId, countdown)\n    if event == \"READY_CHECK\" or event == \"CHALLENGE_MODE_START\" or event == \"PARTY_MEMBER_ENABLE\" or event == \"PLAYER_ENTERING_WORLD\" or event == \"GROUP_ROSTER_UPDATE\" then \n        -- Send information about yourself\n        aura_env.sendPlayerInfo()\n        -- Update playermark\n        aura_env.updatePlayerMarks()\n    end\n    if event == \"CHALLENGE_MODE_START\" then \n        -- Add Seasonal Mobs to table\n        WeakAuras.ScanEvents(\"AUTOMARK_GET_MOBS\", C_MythicPlus.GetCurrentSeason())\n    end\n    if event == \"GROUP_ROSTER_UPDATE\" then \n        for player in pairs(aura_env.partyMembers) do \n            local member = false\n            for unit in WA_IterateGroupMembers() do\n                local name = unit == \"player\" and string.format(\"%s-%s\", UnitFullName(unit)) or string.format(\"%s-%s\", UnitName(unit), GetNormalizedRealmName(unit))\n                if player == name then member = true break end \n            end\n            if not member then aura_env.partyMembers[player] = nil end -- Player has left party, remove as member. \n        end\n        -- if aura_env.config.settings.debug then ViragDevTool_AddData(aura_env.partyMembers, \"aura_env.partyMembers\") end\n    end\n    if event == \"START_TIMER\" and countdown > 0 and not select(3, C_ChallengeMode.GetActiveKeystoneInfo()) then \n        return true\n    end\n    -- Player is not marker\n    if not aura_env.partyMembers[aura_env.GetPlayerName()].marker then return end\n    -- Automark: Mouseover\n    if (event == \"UPDATE_MOUSEOVER_UNIT\" or event == \"MODIFIER_STATE_CHANGED\") \n    and UnitExists(\"mouseover\") \n    and not UnitIsDead(\"mouseover\") \n    and not UnitIsPlayer(\"mouseover\") \n    and not GetRaidTargetIndex(\"mouseover\") then\n        -- Grabbing some values\n        local guid, npcID = UnitGUID(\"mouseover\"), select(6, strsplit(\"-\", UnitGUID(\"mouseover\")))\n        npcID = tonumber(npcID)\n        if not aura_env.mobs[npcID] then return end -- NPC is not in table\n        local _, maxRange = aura_env.rc:GetRange('mouseover')\n        local key = {\n            [1] = true,\n            [2] = IsShiftKeyDown(),\n            [3] = IsControlKeyDown(),\n            [4] = IsAltKeyDown(),\n        }\n        -- Does the npcID exist in our table?\n        if aura_env.mobs[npcID] \n        and aura_env.mobs[npcID].autoMarkOption == 2 \n        and key[aura_env.config.settings.mouseover.modifier] \n        and (aura_env.mobs[npcID].distance == 10\n            and aura_env.range[aura_env.config.settings.mouseover.markDistance](maxRange, guid)\n            or aura_env.range[aura_env.mobs[npcID].distance](maxRange, guid)) then\n            aura_env.CreateMarkOnUnitId(\"mouseover\", guid)\n        end\n    end\n    -- Automark: Nameplate\n    if event == \"NAME_PLATE_UNIT_ADDED\" and unitId then\n        local guid, npcID = UnitGUID(unitId), select(6, strsplit(\"-\", UnitGUID(unitId)))\n        npcID = tonumber(npcID)\n        if aura_env.mobs[npcID] and aura_env.mobs[npcID].autoMarkOption == 3 then\n            aura_env.CreateMarkOnUnitId(unitId, guid)\n        end\n    end\n    -- Automark: Nameplate + combat \n    if event == \"UNIT_THREAT_LIST_UPDATE\" and unitId and UnitAffectingCombat(unitId) and UnitExists(unitId) and GetRaidTargetIndex(unitId) == nil then\n        local guid, npcID = UnitGUID(unitId), select(6, strsplit(\"-\", UnitGUID(unitId)))\n        npcID = tonumber(npcID)\n        if aura_env.mobs[npcID] and aura_env.mobs[npcID].autoMarkOption == 4 then\n            aura_env.CreateMarkOnUnitId(unitId, guid)\n        end\n    end\nend\n\n-- GROUP_ROSTER_UPDATE, UPDATE_MOUSEOVER_UNIT, NAME_PLATE_UNIT_ADDED, UNIT_THREAT_LIST_UPDATE, READY_CHECK, CHALLENGE_MODE_START, PARTY_MEMBER_ENABLE, START_TIMER, MODIFIER_STATE_CHANGED",
