 \n                elseif senderRole == \"DAMAGER\" and markerRole == \"HEALER\" and not markerLeader and senderBuildOption >= markerBuildOption then \n                    change = true \n                elseif senderRole == markerRole and not markerLeader and senderBuildOption >= markerBuildOption and senderDeciderValue > markerDeciderValue then\n                    change = true \n                end\n            end\n            if aura_env.partyMembers[sender].role ~= senderRole or \n            aura_env.partyMembers[sender].leader ~= senderLeader or \n            aura_env.partyMembers[sender].mobs ~= senderMarkMobs or \n            aura_env.partyMembers[sender].players ~= senderMarkPlayers or \n            aura_env.partyMembers[sender].build ~= senderBuildOption then -- Has any values changed?\n                aura_env.partyMembers[sender].role = senderRole\n                aura_env.partyMembers[sender].mobs = senderMarkMobs\n                aura_env.partyMembers[sender].players = senderMarkPlayers\n                aura_env.partyMembers[sender].leader = senderLeader\n                aura_env.partyMembers[sender].decider = senderDeciderValue\n                aura_env.partyMembers[sender].build = senderBuildOption\n                if sender ~= aura_env.GetPlayerName() then \n                    aura_env.sendPlayerInfo() \n                end \n            end\n            if change and not aura_env.partyMembers[sender].marker then \n                -- Make old marker inactive\n                if aura_env.partyMembers[marker] then aura_env.partyMembers[marker].marker = false end\n                -- A new player becomes main marker\n                aura_env.partyMembers[sender] = {\n                    [\"marker\"] = true,\n                    [\"role\"] = senderRole,\n                    [\"mobs\"] = senderMarkMobs,\n                    [\"players\"] = senderMarkPlayers,\n                    [\"leader\"] = senderLeader,\n                    [\"decider\"] = senderDeciderValue,\n                    [\"build\"] = senderBuildOption,\n                }\n                return true\n            end\n        end\n    end\nend\n\n-- CHAT_MSG_ADDON",
