						["custom"] = "function(states, event, ...)\n    if event == \"CHAT_MSG_ADDON\" and ... then\n        local prefix, message = ...\n        if prefix == \"HYLB_PERSONAL\" and message then\n            local topLeft, topRight, bottomLeft, bottomRight = strsplit(\"*\", message)\n            if topLeft and topRight and bottomLeft and bottomRight then\n                local cfg = aura_env.config\n                states[\"\"] = {\n                    side = {\n                        [topLeft] = cfg[\"1\"],\n                        [topRight] = cfg[\"2\"],\n                        [bottomLeft] = cfg[\"3\"],\n                        [bottomRight] = cfg[\"4\"],\n                    },\n                    progressType = \"static\",\n                    changed = true,\n                    show = true,\n                }\n                return true\n            end\n            \n        end\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, message, _, _, _, _, _, _, _, _, _, spellid = ...\n        local state = states[\"\"]\n        if state and (message == \"SPELL_AURA_APPLIED\" or message == \"SPELL_AURA_REMOVED\") and spellid == 347097 then\n            state.show = false\n            state.changed = true\n            return true\n        end\n    end\nend",
