ock = true, no_icon = true, },\n        },\n        [\"1819\"] = {\n            [0] = { angle = 30, next_room = 10, block = true, },\n            [1] = { angle = 180, next_room = 19, entrance = true, block = true, },\n            [2] = { angle = 270, next_room = \"BOSS\" },\n            [3] = { angle = 330, next_room = 17 },\n        },\n        [\"1918\"] = {\n            [0] = { angle = 0, next_room = 20, message = L[\"↑正对面↑\"] },\n            [1] = { angle = 130, next_room = \"BOSS\", message = L[\"→右起第1个→\"] },\n            [2] = { angle = 180, next_room = 18, entrance = true, block = true, },\n            [3] = { angle = 235, next_room = 11, block = true, },\n        },\n        [\"1920\"] = {\n            [0] = { angle = 35, next_room = 11, block = true, },\n            [1] = { angle = 180, next_room = 20, entrance = true, block = true, },\n            [2] = { angle = 310, next_room = \"BOSS\", message = L[\"←左边第1个←\"] },\n            [3] = { angle = 350, next_room = 18 },\n        },\n        [\"1911\"] = {\n            [0] = { angle = 40, next_room = \"BOSS\", message = L[\"↗对面，偏右↗\"] },\n            [1] = { angle = 110, next_room = 18 },\n            [2] = { angle = 180, next_room = 11, entrance = true, block = true, },\n            [3] = { angle = 305, next_room = 20 },\n        },\n        [\"2014\"] = {\n            [0] = { angle = 55, next_room = \"BOSS\", message = L[\"↗右前方↗\"] },\n            [1] = { angle = 135, next_room = 19, message = L[\"↘入口旁边↘\"] },\n            [2] = { angle = 240, next_room = 15, block = true, },\n            [3] = { angle = 345, next_room = L[\"假\"], block = true, },\n            [4] = { angle = 180, next_room = 14, entrance = true, block = true, no_icon = true, },\n        },\n        [\"2015\"] = {\n            [0] = { angle = 10, next_room = \"BOSS\", message = L[\"↑正对面↑\"], },\n            [1] = { angle = 100, next_room = 19 },\n            [2] = { angle = 180, next_room = 15, entrance = true, block = true, },\n            [3] = { angle = 270, next_room = L[\"假\"], block = true, },\n        },\n        [\"2019\"] = {\n            [0] = { angle = 45, next_room = \"BOSS\", message = L[\"→右起第1个→\"], },\n            [2] = { angle = 180, next_room = 19, entrance = true, block = true, },\n            [1] = { angle = 230, next_room = 15, block = true, },\n            [3] = { angle = 325, next_room = L[\"假\"], block = true, },\n        },\n    }\n    self.localized_zone_name = {\n        [\"enUS\"] = \"Mistveil Tangle\",\n        [\"koKR\"] = \"안개장막 덩굴숲\",\n        [\"frFR\"] = \"Maquis Voile-de-Brume\",\n        [\"deDE\"] = \"Nebelschleierdickicht\",\n        [\"zhCN\"] = \"纱雾迷结\",\n        [\"esES\"] = \"Espesura Velo de Niebla\",\n        [\"zhTW\"] = \"霧紗密林\",\n        [\"esMX\"] = \"Espesura Veloniebla\",\n        [\"ruRU\"] = \"Туманная чащоба\",\n        [\"ptBR\"] = \"Enleio do Véu da Névoa\",\n        [\"itIT\"] = \"Intrico Velofosco\",\n        [\"ptPT\"] = \"Enleio do Véu da Névoa\",\n    }\nend\n\nfunction e:InitAuthorOptionsLocale()\n    local options = CopyTable(self.saved.authorOptions)\n    local translation = CopyTable(L_options)\n    for i = 1, #options do\n        for k, v in pairs(translation[i]) do options[i][k] = v end\n    end\n    self.saved.authorOptions = options\nend\n\n--COMBAT_LOG_EVENT_UNFILTERED, WA_MIST_NAV, PLAYER_REGEN_DISABLED, PLAYER_REGEN_ENABLED, ZONE_CHANGED, ZONE_CHANGED_INDOORS, PLAYER_ENTERING_WORLD,ENCOUNTER_START,ENCOUNTER_END,BOSS_KILL,WA_MIST_NAV_DEBUG\nfunction e:ON_EVENT(allstates, event, sub_event, ...)\n    if event == \"WA_MIST_NAV_DEBUG\" then\n        self.debug = true\n        event = sub_event\n        return self:_ON_EVENT(allstates, event, ...)\n    else\n        self.debug = false\n        return self:_ON_EVENT(allstates, event, sub_event, ...)\n    end\nend\n\nfunction e:_ON_EVENT(allstates, event, ...)\n    if (self.player_in_maze or self.debug) and event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local _,sub_event,_,_,_,_,_,destGUID,destName = CombatLogGetCurrentEventInfo()\n        if self.debug then\n            sub_event, destGUID = ...\n            self.player_in_maze = true \n        end\n        if sub_event == \"UNIT_DIED\" then\n            return self:ON_UNIT_DIED(destGUID)\n        elseif sub_event ~= \"SPELL_DAMAGE\" then\n            return nil\n        end\n        local guid = destGUID\n        if not guid or self.mobs_seen[guid] then return nil end\n        self.mobs_seen[guid] = true\n        local mob_id = select(6, strsplit(\"-\",guid))\n        mob_id = tonumber(mob_id)\n        if not (mob_id and self:IsSpecialMob(mob_id)) then return nil end\n        local name = destName\n        local combat = self.combat\n        self.mob_record[combat] = self.mob_record[combat] or {}\n        local info = self.mob_record[combat][mob_id]\n        if not info then\n            self.mob_record[combat][mob_id] = {name = name, guids = {[guid] = true}, count = 1}\n        elseif not info.guids[guid] then\n            info.guids[guid] = true\n            info.count = info.count + 1\n        else\n            return nil\n        end\n        self:MapHide(allstates)\n        self.room_map_show_cache = nil\n        self.player_in_combat = true\n        self:LocatePlayerRoom()\n        self:FindSolution()\n        return true\n    elseif event == \"ZONE_CHANGED\" or event == \"ZONE_CHANGED_INDOORS\" or event == \"PLAYER_ENTERING_WORLD\" then\n        self:CheckPlayerMapZone()\n    elseif event == \"ENCOUNTER_START\" then\n        local encounter_id = ...\n        if encounter_id == 2392 then\n            self:MazeReset(allstates)\n        end\n        return true\n    elseif event == \"BOSS_KILL\" then\n        local encounter_id = ...\n        if encounter_id == 2397 then\n            C_Timer.After(8, function () e:ReportVersion() end)\n            self:MazeReset(allstates)\n        end\n    elseif event == \"PLAYER_REGEN_ENABLED\" then\n        self.player_in_combat = false\n        if (not self.room_map_show) and self.config.show_out_combat == 1 then self:DisplayButtonClick() end\n        self:GoToNextRoom()\n        -- elseif event == \"PLAYER_REGEN_DISABLED\" then\n        --     self.player_in_combat = true\n    elseif event == self.addon_name then\n        local sub_event = ...\n        if sub_event == \"ShowRoom\" then\n            self:MapHide(allstates)\n            local room_in, room_from, room_to, solution_info = select(2, ...)\n            \n            if self.config.announce_direction then\n                self:AnnounceDirection(room_in, room_from, room_to, solution_info)\n            end\n            \n            local solution_string = self:GetSolutionString(solution_info)\n            self.display_button:Show()\n            self.room_map_show_cache = {room_in = room_in, room_from = room_from, room_to = room_to, solution_string = solution_string}\n            \n            if self.player_in_combat then\n                if self.config.show_in_combat ~= 3 then\n                    WeakAuras.ScanEvents(self.addon_name, \"MapShow\", room_in, room_from, room_to, solution_string)\n                    if self.config.show_in_combat == 2 then C_Timer.After(5, function () e:AutoHideInCombat() end) end\n                end\n            else\n                WeakAuras.ScanEvents(self.addon_name, \"MapShow\", room_in, room_from, room_to, solution_string)\n            end\n        elseif sub_event == \"MapShow\" then\n            self:MapHide(allstates)\n            local room_in, room_from, room_to, solution_string = select(2, ...)\n            self:MapShow(allstates, room_in, room_from, room_to, solution_string)\n            return true\n        elseif sub_event == \"MapHide\" then\n            self:MapHide(allstates)\n            return true\n        end\n    end\nend\n\nfunction e:CheckPlayerMapZone()\n    local minimap_zone = GetMinimapZoneText()\n    local locale = GetLocale()\n    local maze_name = self.localized_zone_name[locale]\n    if minimap_zone and maze_name and minimap_zone == maze_name then self.player_in_maze = true else self.player_in_maze = false end\nend\n\nfunction e:ON_UNIT_DIED(died_guid)\n    if not died_guid then return nil end\n    local mob_record = self.mob_record[self.combat]\n    if not mob_record then return nil end\n    local mob_id = select(6, strsplit(\"-\",died_guid))\n    mob_id = tonumber(mob_id)\n    if not (mob_id and mob_record[mob_id]) then return nil end\n    local mob_guids = mob_record[mob_id].guids\n    if not mob_guids then return nil end\n    if mob_guids[died_guid] then \n        mob_guids[died_guid] = \"DEAD\" \n    end\n    local mob_remain = false\n    for _, info in pairs(mob_record) do\n        for _, value in pairs(info.guids) do\n            if value ~= \"DEAD\" then mob_remain = true end\n        end\n    end\n    if not mob_remain then \n        self.player_in_combat = false\n        if (not self.room_map_show) and self.config.show_out_combat == 1 then self:DisplayButtonClick() end\n        self:GoToNextRoom() \n    end\nend\n\nfunction e:GoToNextRoom()\n    if self.cur_room then\n        self.cur_room = nil\n        self.last_solution_current = self.solution_current\n        self.combat = self.combat + 1\n    end\nend\n\nfunction e:ReportVersion()\n    if self.config.announce_version then\n        if IsInGroup(LE_PARTY_CATEGORY_HOME) then \n            SendChatMessage(L[\"仙林迷宫全自动导航已加载，版本：\"] .. self.version, \"PARTY\")\n        elseif IsInGroup(LE_PARTY_CATEGORY_INSTANCE) then \n            SendChatMessage(L[\"仙林迷宫全自动导航已加载，版本：\"] .. self.version, \"INSTANCE_CHAT\")\n        end\n    end\nend\n\nfunction e:MazeReset(allstates)\n    self:MapHide(allstates)\n    self.combat = 1\n    self.room_map_show_cache = nil\n    self.display_button:Hide()\n    wipe(self.mob_record)\n    wipe(self.mobs_seen)\n    self:InitSolutionCurrent()\nend\n\nfunction e:CreateDisplayButton()\n    local button = CreateFrame(\"Button\", self.addon_name..\"_Button\", UIParent, \"UIPanelButtonTemplate\")\n    button:SetSize(150, 32)\n    button:SetText(L[\"显示/隐藏导航\"])\n    button:SetScript(\"OnClick\", function() e:DisplayButtonClick() end)\n    button:SetFrameStrata(\"TOOLTIP\")\n    button:SetPoint(\"TOP\",UIParent,\"TOP\",0,-100)\n    button:RegisterForDrag(\"LeftButton\")\n    button:SetScript(\"OnDragStart\", button.StartMoving)\n    button:SetScript(\"OnDragStop\", button.StopMovingOrSizing)\n    button:SetMovable(true)\n    button:EnableMouse(true)\n    return button\nend\n\n\nfunction e:DisplayButtonClick()\n    if self.room_map_show then\n        WeakAuras.ScanEvents(self.addon_name, \"MapHide\")\n    elseif not self.room_map_show and self.room_map_show_cache then\n        local cache = self.room_map_show_cache\n        WeakAuras.ScanEvents(self.addon_name, \"MapShow\", cache.room_in, cache.room_from, cache.room_to, cache.solution_string)\n    end\nend\n\nfunction e:CreateDirectionLine()\n    local parent = WeakAuras.GetRegion(self.id)\n    local direction_line = CreateFrame(\"Frame\", self.addon_name..\"_DirectionLine\", UIParent)\n    direction_line:SetPoint(\"CENTER\", parent, \"CENTER\", 0, 0)\n    direction_line:SetSize(1000,1000)\n    local positions = {\"start\", \"turn\", \"end\", \"arrow_left\", \"arrow_right\"}\n    local lines = {}\n    for _, pos in pairs(positions) do\n        lines[pos] = direction_line:CreateLine()\n        lines[pos]:SetColorTexture(0,1,0.28,0.4)\n        lines[pos]:SetThickness(8)\n    end\n    direction_line.lines = lines\n    direction_line:Hide()\n    return direction_line\nend\n\nfunction e:SetDirectionLine(end_angle, start_angle)\n    if not end_angle then return nil end\n    start_angle = start_angle or 180\n    local radius = self.config.radius or 300\n    local lines = self.direction_line.lines\n    local angle = start_angle\n    local x = 0.9 * radius * math.sin(angle / 180 * math.pi)\n    local y = 0.9 * radius * math.cos(angle / 180 * math.pi)\n    lines.start:SetStartPoint(\"CENTER\",x,y)\n    x = 0.5 * radius * math.sin(angle / 180 * math.pi)\n    y = 0.5 * radius * math.cos(angle / 180 * math.pi)\n    lines.start:SetEndPoint(\"CENTER\",x,y)\n    lines.turn:SetStartPoint(\"CENTER\",x,y)\n    angle = end_angle\n    x = 0.5 * radius * math.sin(angle / 180 * math.pi)\n    y = 0.5 * radius * math.cos(angle / 180 * math.pi)\n    lines.turn:SetEndPoint(\"CENTER\",x,y)\n    lines[\"end\"]:SetStartPoint(\"CENTER\",x,y)\n    x = 0.9 * radius * math.sin(angle / 180 * math.pi)\n    y = 0.9 * radius * math.cos(angle / 180 * math.pi)\n    lines[\"end\"]:SetEndPoint(\"CENTER\",x,y)\n    lines.arrow_left:SetStartPoint(\"CENTER\",x,y)\n    lines.arrow_right:SetStartPoint(\"CENTER\",x,y)\n    local arrow_angle = end_angle + 30\n    arrow_angle = (arrow_angle < 0 and (360 + arrow_angle)) or (arrow_angle >= 360 and (arrow_angle - 360)) or arrow_angle\n    local arrow_x = x - radius * 0.2 * math.sin(arrow_angle / 180 * math.pi)\n    local arrow_y = y - radius * 0.2 * math.cos(arrow_angle / 180 * math.pi)\n    lines.arrow_left:SetEndPoint(\"CENTER\",arrow_x,arrow_y)\n    arrow_angle = end_angle - 30\n    arrow_angle = (arrow_angle < 0 and (360 + arrow_angle)) or (arrow_angle >= 360 and (arrow_angle - 360)) or arrow_angle\n    arrow_x = x - radius * 0.2 * math.sin(arrow_angle / 180 * math.pi)\n    arrow_y = y - radius * 0.2 * math.cos(arrow_angle / 180 * math.pi)\n    lines.arrow_right:SetEndPoint(\"CENTER\",arrow_x,arrow_y)\n    self.direction_line:Show()\nend\n\nfunction e:AutoHideInCombat()\n    if self.room_map_show and self.player_in_combat then\n        WeakAuras.ScanEvents(self.addon_name, \"MapHide\")\n    end\nend\n\nfunction e:MapShow(allstates, room_in, room_from, room_to, solution_string)\n    room_to = self:RoomStringformat(room_to)\n    local room_info = self:GetRoomInfo(room_in, room_from)\n    if not room_info then return true end\n    local exit_message\n    local has_exit\n    local radius = self.config.radius or 300\n    local direction_line_angle_start, direction_line_angle_end\n    for _, stone in pairs(room_info) do\n        local x = self.saved.xOffset + radius * math.sin(stone.angle / 180 * math.pi)\n        local y = self.saved.yOffset + radius * math.cos(stone.angle / 180 * math.pi)\n        local block = stone.block or false\n        local entrance = stone.entrance or false\n        local exit = room_to and stone.next_room and room_to == stone.next_room\n        if entrance then direction_line_angle_start = stone.angle end\n        if exit then\n            has_exit = true\n            exit_message = stone.message \n            direction_line_angle_end = stone.angle\n        end\n        local name = (type(stone.next_room) == \"number\" or type(stone.next_room) == \"string\") and stone.next_room or \"\"\n        local texture\n        if stone.no_icon then texture = \"\" else texture = self.saved.texture end\n        local sub_text = (entrance and L[\"入口\"]) or (exit and L[\"出口\"])\n        local state = {\n            show = true,\n            changed = true,\n            block = block,\n            entrance = entrance,\n            exit = exit,\n            texture = texture,\n            name = name,\n            sub_text = sub_text,\n            x = x,\n            y = y,\n        }\n        allstates[#allstates+1] = state\n    end\n    \n    if has_exit then\n        for _, state in pairs(allstates) do\n            if not state.exit then state.block = true end\n        end\n    end\n    \n    local message = \"\"\n    if solution_string and self.config.show_solution then message = message .. solution_string .. \"\\n\" end\n    if exit_message and self.config.show_direction then message = message .. L[\"出口：\"] .. exit_message.. \"\\n\"  end  --出口位置说明\n    local state = {\n        show = true,\n        changed = true,\n        name = message,\n        texture = \"\",\n        is_message = true,\n        x = 0,\n        y = radius * 0.6,\n    }\n    allstates[#allstates+1] = state\n    self.room_map_show = true\n    if self.config.show_direction_line then self:SetDirectionLine(direction_line_angle_end, direction_line_angle_start) end\n    return true\nend\n\nfunction e:MapHide(allstates)\n    for _, state in pairs(allstates) do\n        state.show = false\n        state.changed = true\n    end\n    self.room_map_show = false\n    self.direction_line:Hide()\n    return true\nend\n\nfunction e:ON_SHOW(aura_env_clone)\n    local state = aura_env_clone.state\n    local region = aura_env_clone.region\n    region:SetOffset(state.x, state.y)\nend\n\nfunction e:MobsCombine(...)\n    local result = {}\n    for _, room_index in ipairs({...}) do\n        local mobs = self.room_mob_list[room_index]\n        if mobs then\n            for mob_id, count in pairs(mobs) do\n                result[mob_id] = result[mob_id] and result[mob_id] + count or count\n            end\n        end\n    end\n    return result\nend\n\nfunction e:IsSpecialMob(mob_id)\n    if self.mobs_list[mob_id] then return true else return false end\nend\n\nfunction e:LocatePlayerRoom()\n    if not self.combat then return nil end\n    self.cur_room = nil\n    local possible_next_list = self:GetPossibleNext()\n    for _, room_index in pairs(possible_next_list) do\n        local data = self.room_mob_list[room_index]\n        local record = self.mob_record[self.combat]\n        if self:MobsMatch(record, data) then self:AddCurrentRoom(room_index) end\n        --combine pull\n        local possible_combines = self.combine_pull[room_index]\n        if possible_combines then\n            for _, combine_pull in pairs(possible_combines) do\n                data = self:MobsCombine(room_index, combine_pull)\n                if self:MobsMatch(record, data) then self:AddCurrentRoom(room_index, combine_pull) end\n            end\n        end\n    end\nend\n\nfunction e:MobsMatch(record, data)\n    for mob_id, info in pairs(record) do\n        if data[mob_id] ~= info.count then return false end\n    end\n    for mob_id, count in pairs(data) do\n        if not (record[mob_id] and record[mob_id].count == count) then return false end\n    end\n    return true\nend\n\nfunction e:InitSolutionCurrent()\n    local solution_current = {}\n    for _, solution in pairs(self.maze_solutions) do\n        solution_current[solution] = 0\n    end\n    self.last_solution_current = solution_current\nend\n\nfunction e:GetPossibleNext()\n    local possible_next_list = {}\n    for solution, current in pairs(self.last_solution_current) do\n        local next_room = solution[current+1]\n        if next_room and not tContains(possible_next_list, next_room) then \n            table.insert(possible_next_list, next_room) \n        end\n    end\n    return possible_next_list\nend\n\nfunction e:AddCurrentRoom(room_index,combine_pull)\n    self.cur_room = self.cur_room or {}\n    if combine_pull then\n        local combine = {room_index, combine_pull}\n        local match = false\n        for _, room in pairs(self.cur_room) do\n            if type(room) == \"table\" and table.concat(room,\",\") == table.concat(combine,\",\") then match = true end \n        end\n        if not match then \n            table.insert(self.cur_room, combine)\n            self:PrintMessage(string.format(L[\"进入房间：%s， 勾怪：%s\"], tostring(self:GetLocalizedRoom(room_index)), tostring(self:GetLocalizedRoom(combine_pull))))\n        end\n    else\n        if not tContains(self.cur_room, room_index) then \n            table.insert(self.cur_room, room_index) \n            self:PrintMessage(string.format(L[\"进入房间：%s\"], tostring(self:GetLocalizedRoom(room_index))))\n        end\n    end\nend\n\nfunction e:FindSolution()\n    if not self.cur_room then return nil end\n    self.show_infos = {}\n    local solution_current = {}\n    for solution, current in pairs(self.last_solution_current) do\n        for _, cur_room in pairs(self.cur_room) do\n            if type(cur_room) == \"table\" then\n                local solution_next_room1 = solution[current+1]\n                local solution_next_room2 = solution[current+2]\n                if solution_next_room1 == cur_room[1] and solution_next_room2 == cur_room[2] then\n                    solution_current[solution] = current+2\n                    self:ShowInfoAdd(solution, current+1)\n                    self:ShowInfoAdd(solution, current+2)\n                elseif solution_next_room1 == cur_room[1] then\n                    solution_current[solution] = current+1\n                    self:ShowInfoAdd(solution, current+1)\n                end\n            else\n                local solution_next_room = solution[current+1]\n                if solution_next_room == cur_room then\n                    solution_current[solution] = current+1\n                    self:ShowInfoAdd(solution, current+1)\n                end\n            end\n        end\n    end\n    self.solution_current = solution_current\n    \n    local possible_solutions = {}\n    for solution, _ in pairs(solution_current) do\n        table.insert(possible_solutions, solution)\n    end\n    \n    if #possible_solutions > 0 then\n        --print all possible\n        if self.config.print_all_possible then\n            if #possible_solutions > 1 then\n                for _, solution in pairs(possible_solutions) do\n                    local solution_string = self:GetSolutionString({solution = solution})\n                    self:PrintMessage(string.format(L[\"可能解：%s\"], solution_string))\n                end\n            end\n        end\n        --show zone map\n        if #possible_solutions == 1 then\n            local solution = possible_solutions[1]\n            local solution_string = self:GetSolutionString({solution = solution})\n            self:PrintMessage(string.format(L[\"找到唯一路线！！  %s\"], solution_string)) \n            self:ShowInfo(true)\n        elseif not self.config.show_only_solution then\n            self:ShowInfo(false)\n        end\n    end\nend\n\nfunction e:ShowInfoAdd(solution, current)\n    local room_in = solution[current]\n    local room_from = solution[current-1] or 0\n    local room_to = solution[current+1] or \"BOSS\"\n    local solution_info = self:GetSolutionInfo(solution, current)\n    local room_string = table.concat({room_in, room_from}, \", \")\n    local match = false\n    for _, show_info in pairs(self.show_infos) do\n        local show_info_string = table.concat({show_info.room_in, show_info.room_from}, \", \")\n        if show_info_string == room_string then match = true break end \n    end\n    \n    if not match then table.insert(self.show_infos, {room_in = room_in, room_from = room_from, room_to = room_to, solution_info = solution_info}) end\nend\n\nfunction e:GetSolutionInfo(solution, current)\n    local info = {}\n    info.solution = CopyTable(solution)\n    info.current = current\n    info.end_progress = self:CalculatePride(solution, current)\n    return info\nend\n\nfunction e:GetSolutionString(solution_info)\n    if not solution_info then return nil end\n    local solution_copy = CopyTable(solution_info.solution)\n    for i = 1, #solution_copy do \n        solution_copy[i] = self:GetLocalizedRoom(solution_copy[i]) \n    end\n    local current = solution_info.current\n    local current_texture = \"\\124T132147:16\\124t\"\n    if current then\n        solution_copy[current] = string.format(\"%s%s\", current_texture, tostring(solution_copy[current]))\n    end\n    \n    local end_progress = solution_info.end_progress\n    local solution_string = table.concat(solution_copy, \" > \")\n    if end_progress and self.config.show_end_progress then solution_string = string.format(L[\"%s | 结束：%.2f%%\"], solution_string, end_progress * 100) end\n    return solution_string\nend\n\nfunction e:ShowInfo(unique)\n    self.display_button:Show()\n    self.room_button_pool:ReleaseAll()\n    wipe(self.room_buttons)\n    local total = #self.show_infos\n    for i, show_info in pairs(self.show_infos) do\n        local x_offset = (i - (total+ 1)/2) * total * 32\n        local button = self.room_button_pool:Acquire()\n        button.index = i\n        button:SetSize(64, 32)\n        button:SetText(show_info.room_in)\n        button:SetScript(\"OnClick\", function() e.room_button_highlighted=i e:RoomButtonClick(i, unique) end)\n        button:SetFrameStrata(\"TOOLTIP\")\n        button:SetPoint(\"TOP\",self.display_button,\"BOTTOM\",x_offset,-10)\n        if total > 1 then button:Show() else button:Hide() end\n        if i == total then button:LockHighlight() else button:UnlockHighlight() end\n        table.insert(self.room_buttons, button)\n    end\n    local show_info = self.show_infos[total]\n    if unique then\n        WeakAuras.ScanEvents(self.addon_name, \"ShowRoom\", show_info.room_in, show_info.room_from, show_info.room_to, show_info.solution_info)\n    else\n        WeakAuras.ScanEvents(self.addon_name, \"ShowRoom\", show_info.room_in, show_info.room_from)\n    end\nend\n\nfunction e:RoomButtonClick(index, unique)\n    for _, button in pairs(self.room_buttons) do\n        if button.index == index then button:LockHighlight() else button:UnlockHighlight() end\n    end\n    local show_info = self.show_infos[index]\n    if unique then\n        local solution_string = self:GetSolutionString(show_info.solution_info)\n        WeakAuras.ScanEvents(self.addon_name, \"MapShow\", show_info.room_in, show_info.room_from, show_info.room_to, solution_string)\n    else\n        WeakAuras.ScanEvents(self.addon_name, \"MapShow\", show_info.room_in, show_info.room_from)\n    end\nend\n\n\nfunction e:GetLocalizedRoom(room)\n    if type(room) ~= \"string\" or not L[room] then \n        return room\n    else\n        return L[room]\n    end\nend\n\nfunction e:RoomStringformat(room)\n    if type(room) ~= \"string\" then return room end\n    local post = string.find(room, \"_\")\n    if post then room = string.sub(room, 1, post-1) end\n    post = string.find(room, \"&\")\n    if post then room = string.sub(room, 1, post-1) end\n    return tonumber(room) or room\nend\n\nfunction e:GetRoomInfo(room_in, room_from)\n    room_in = self:RoomStringformat(room_in)\n    room_from = self:RoomStringformat(room_from)\n    local room_in_string = tostring(room_in)\n    local room_from_string = tostring(room_from)\n    room_in_string = #room_in_string >= 2 and room_in_string or \"0\" .. room_in_string\n    room_from_string = #room_from_string >= 2 and room_from_string or \"0\" .. room_from_string\n    local room_string = strjoin(\"\",room_in_string,room_from_string)\n    local room_info = self.room_info[room_string]\n    if room_info then return room_info end\nend\n\nfunction e:AnnounceDirection(room_in, room_from, room_to, solution_info) --队伍通告\n    local room_info = self:GetRoomInfo(room_in, room_from)\n    room_to = self:RoomStringformat(room_to)\n    if not room_info then return nil end\n    local exit_message\n    for _, stone in pairs(room_info) do\n        if room_to and stone.next_room and room_to == stone.next_room then exit_message = stone.message break end\n    end\n    if not exit_message then return nil end\n    local channel\n    if IsInGroup(LE_PARTY_CATEGORY_HOME) then \n        channel = \"PARTY\"\n    elseif IsInGroup(LE_PARTY_CATEGORY_INSTANCE) then \n        channel = \"INSTANCE_CHAT\"\n    end\n    if channel then\n        local message = self:GetProgressMessage(solution_info)\n        if message then C_Timer.After(5, function () SendChatMessage(message, channel) end) end\n        SendChatMessage(L[\"出口：\"] .. exit_message, channel) \n    else\n        local message = self:GetProgressMessage(solution_info)\n        if message then print(message) end\n        print(L[\"出口：\"] .. exit_message)\n    end\nend\n\nfunction e:GetProgressMessage(solution_info) --队伍进度信息\n    local solution = CopyTable(solution_info.solution)\n    local current, end_progress = solution_info.current, solution_info.end_progress\n    if not end_progress then return nil end\n    \n    local message = \"\"\n    if self.config.announce_end_progress then\n        message = message .. string.format(L[\"结束：%.2f%%\"], end_progress * 100)\n    end\n    return message\nend\n\nfunction e:CalculatePride(solution, current)\n    local current_progress = self:GetCurrentProgress()\n    local current_combat_progress = self:GetMobProgressCurrentCombat()\n    local room_left_progress = self:GetMobProgressForRoomLeft(solution, current)\n    if current_progress and current_combat_progress and room_left_progress then\n        local total = 260\n        local pre_progress = current_progress\n        local post_progress = current_progress + current_combat_progress / total\n        for i = current + 1, #solution do\n            pre_progress = post_progress\n            post_progress = post_progress + room_left_progress[i] / total\n        end\n        return post_progress\n    end\nend\n\nfunction e:GetCurrentProgress()\n    local _,_,steps = C_Scenario.GetStepInfo()\n    if not steps or steps <= 0 then\n        return\n    end\n    local percent\n    local _, _, _, _, total, _, _, current = C_Scenario.GetCriteriaInfo(steps)\n    if current then\n        current = tonumber(string.sub(current, 1, string.len(current) - 1)) or 0\n        percent = current / total\n        if percent then\n            percent = (percent <= 0 and 0) or (percent > 100 and 100) or percent\n            return percent\n        end\n    end\n    return false\nend\n\nfunction e:GetMobProgressCurrentCombat()\n    local mob_record = self.mob_record[self.combat]\n    if not mob_record then return nil end\n    local progress = 0\n    for mob_id, info in pairs(mob_record) do\n        for _, value in pairs(info.guids) do\n            if value ~= \"DEAD\" then \n                progress = progress + self.mobs_list[mob_id].progress\n            end\n        end\n    end\n    return progress\nend\n\nfunction e:GetMobProgressForRoomLeft(solution, current)\n    local progress = {}\n    for i = current + 1, #solution do\n        local room = solution[i]\n        local mobs = self.room_mob_list[room]\n        local room_progress = 0\n        for mob_id, count in pairs(mobs) do\n            room_progress = room_progress + self.mobs_list[mob_id].progress * count\n        end\n        progress[i] = room_progress\n    end\n    return progress\nend\n\nfunction e:PrintMessage(message)\n    if not message then return nil end\n    if self.config.print_in_errorframe then\n        UIErrorsFrame:AddMessage(message, 1.0, 1.0, 1.0, 53, 10);\n    else\n        print(message)\n    end\nend\n\ne:Init()",
