				["init"] = {
					["custom"] = "local t = {\n    [1] = {\"TOPLEFT\", 1323035, \"BLUE\", \"{rt6}\"},\n    [2] = {\"TOPRIGHT\", 1323037, \"PURPLE\", \"{rt3}\"},\n    [3] = {\"BOTTOMLEFT\", 1323038, \"YELLOW\", \"{rt1}\"},\n    [4] = {\"BOTTOMRIGHT\", 1323039, \"ORANGE\", \"{rt2}\"},\n}\n\nlocal name = \"HYLB\"\nlocal w, h = aura_env.region:GetSize()\nfor i=1, 4 do\n    \n    aura_env.region[\"button\"..i] = aura_env.region[\"button\"..i] or CreateFrame(\"Button\", name..i, aura_env.region)\n    aura_env.region[\"button\"..i]:SetSize(w/2, h/2)\n    aura_env.region[\"button\"..i]:SetPoint(t[i][1])\n    aura_env.region[\"button\"..i]:SetScript(\"OnClick\", function()\n            WeakAuras.ScanEvents(\"HYLB_BOTTOMLEFT\", t[i][2], t[i][3], i, t[i][4])\n    end)\n    \n    aura_env.region[\"button\"..i]:SetNormalTexture(t[i][2])\n    aura_env.region[\"button\"..i]:SetHighlightTexture(\"Interface\\\\QuestFrame\\\\UI-QuestLogTitleHighlight\", \"ADD\")\nend\n\naura_env.handle = function(show)\n    for i=1, 4 do\n        if show then\n            aura_env.region[\"button\"..i]:Show()\n        else\n            aura_env.region[\"button\"..i]:Hide()\n        end\n    end\nend\naura_env.handle(not WeakAuras.IsOptionsOpen())",
